import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Button, Image} from 'react-bootstrap';
import logo from '../../res/23619.jpeg';
import './home.css';
import LeafsComponents from './subcomponents/LeafsComponents';
const Home = () => {
  return (
    <div style={{position: 'relative'}}>
      <img object-fit="contain" src={logo} class="sliderImage" />
      <LeafsComponents />
      <div
        style={{
          justifyContent: 'center',
          justifyItems: 'center',
          display: 'flex',
        }}
      >
        <Card style={{width: '90%', margin: 20}}>
          <Card.Header as="h5">EXPLORE CANADA</Card.Header>
          <Form
            inline
            style={{
              paddingLeft: 20,
              paddingRight: 20,
              paddingTop: 10,
              paddingBottom: 10,
              justifyContent: 'space-between',
            }}
          >
            <Form.Group
              inline
              controlId="formGroupCheckIn"
              style={{marginLeft: 50, flex: 1, justifyContent: 'space-between'}}
            >
              <Form.Label
                style={{fontSize: 14, fontWeight: 'bold', marginRight: 20}}
              >
                Check In
              </Form.Label>
              <Form.Control type="date" placeholder="Start Date" />
            </Form.Group>
            <Form.Group controlId="formGroupCheckout" style={{marginLeft: 50}}>
              <Form.Label
                style={{fontSize: 14, fontWeight: 'bold', marginRight: 20}}
              >
                Check Out
              </Form.Label>
              <Form.Control type="date" placeholder="End Date" />
            </Form.Group>
            <Button style={{marginLeft: 40}}> Search</Button>
          </Form>
        </Card>
      </div>
    </div>
  );
};
export default Home;
